import "./TaskCard.css";
import "../../App.css";
const TaskCard = () => {
    return (
        <div className="containerTaskCard">
            <div className="welcomeText extraLargeText">Bun venit, Bildea Cristian!</div>
            <div className="activityText bigText">Activitati</div>
            <div buttonsActivity>
                <button>1</button>
                <button>2</button>
                <button>3</button>
                <button>4</button>
                <button>5</button>
            </div>
        </div>
    );
}

export default TaskCard;
